    popis: 'Investujte do Fondu Stabilita bez vstupního poplatku'
    text: "<p>V&aacute;žen&aacute; klientko, v&aacute;žen&yacute; kliente,</p>\r\n<p>oslavte s n&aacute;mi Světov&yacute; den investičn&iacute;ch fondů a zainvestujte BEZ VSTUPN&Iacute;HO POPLATKU prostředky do nov&eacute;ho fondu Dluhopisov&eacute; Stability. Tento fond je vhodn&yacute; předev&scaron;&iacute;m pro klienty bez zku&scaron;enost&iacute; s investov&aacute;n&iacute;m, kteř&iacute; preferuj&iacute; n&iacute;zkou m&iacute;ru rizika a do t&eacute;to doby využ&iacute;vaj&iacute; pro zhodnocov&aacute;n&iacute; term&iacute;novan&eacute; vklady nebo spořic&iacute; &uacute;čty.  Nab&iacute;dka na investov&aacute;n&iacute; bez vstupn&iacute;ho poplatku plat&iacute; od 17. 4. do 25. 4.  Chcete se dozvědět v&iacute;ce? Kontaktujte sv&eacute;ho osobn&iacute;ho bank&eacute;ře, nebo se zastavte př&iacute;mo na pobočce.</p>\r\n<p>Va&scaron;e Raiffeisenbank</p>"
